import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { MDBFooter, MDBContainer, MDBIcon, MDBBtn } from 'mdb-react-ui-kit';

const Footer = () => {
  return (
    <MDBFooter className='bg-light text-center text-white fixed-bottom'>
      <MDBContainer className='p-1' 
                style={{
                    backgroundColor: '#6f42c1',
                    color: 'white',
                    width: '100vh'
                  }}
      >
        <div className='mb-1'>
          <MDBBtn tag='a' color='primary' href='#'>
            <MDBIcon fab icon='facebook-f' className='me-2' />
            Facebook
          </MDBBtn>
          <MDBBtn tag='a' color='info' href='#'>
            <MDBIcon fab icon='twitter' className='me-2' />
            Twitter
          </MDBBtn>
          <MDBBtn tag='a' color='danger' href='#'>
            <MDBIcon fab icon='google' className='me-2' />
            Google
          </MDBBtn>
          <MDBBtn tag='a' color='success' href='#'>
            <MDBIcon fab icon='linkedin' className='me-2' />
            LinkedIn
          </MDBBtn>
          <MDBBtn tag='a' color='warning' href='#'>
            <MDBIcon fab icon='instagram' className='me-2' />
            Instagram
          </MDBBtn>
        </div>
      </MDBContainer>
      <div
        className='text-center p-2'
        style={{
          backgroundColor: '#6f42c1',
          color: 'white',
        }}
      >
        Â© 2024 Copyright: Issac & Nelson
      </div>
    </MDBFooter>
  );
};

export default Footer;
